import { Nav } from "react-bootstrap";
import React from "react";
import "./style.css";

const Footer = () => {
  return (
    <div>
      <Nav clasName="footer" style={{ backgroundColor: "#a3aab5" }} activeKey="/home">
        <Nav.Item>NetBlock</Nav.Item>
      </Nav>
    </div>
  );
};

export default Footer;
